import './App.css';
import SearchBar from './components/SearchBar';
import Bugs from './components/Bugs';
import SeaCreatures from './components/SeaCreatures';

function App() {
  return (
    <div className="App">
      <h1>Animal Crossing New Horizons Critterpedia</h1>
      <SearchBar/>
      <Bugs/>
      <SeaCreatures/>
      <Fish/>
    </div>
  );
}

export default App;
